    - type: Paper
      content: >
        Я в cвоём познании настолько преисполнился, что мне уже этот мир абсолютно понятен.


        Я здесь ищу только одного: покоя, умиротворения и вот этой гармонии от слияния с бесконечно вечным, от созерцания этого великого фрактального подобия и этого вот замечательного всеединства существа бесконечно вечного, куда ни посмотри: хоть в глубь — бесконечно малое, хоть ввысь — бесконечно большое, понимаешь?


        Иди, суетись дальше, это твоё распределение, твой путь. Это твой горизонт познания, ощущения и твоей природы. И он несоизмеримо мелок по сравнению с моим. Я как будто уже глубокий старец бессмертный или почти бессмертный, который на этой планете от её самого зарождения, когда Солнце ещё только-только сформировалось как звезда. Я как будто бы уже сто триллионов миллиардов лет проживаю на триллионах и триллионах таких же планет, как эта Земля. Я знаю её вдоль и поперек, как и весь этот мир.


        Я был на этой планете в бесконечном множестве. Я был круче Цезаря, и круче Гитлера, и круче всех великих был. А где-то был конченым говном, ещё хуже, чем здесь. Потому что я множество этих состояний чувствую. Где-то я был больше подобен растению, где-то больше — птице, червю, где-то просто был сгусток камня. Это всё есть душа, она имеет грани подобия совершенно многообразные, бесконечное множество.


        Но тебе этого не понять. Ты не зришь это вечное бесконечное, оно тебе не нужно. Наши пути, конечно, имеют грани подобия, потому что всё едино, но я-то тебя прекрасно понимаю, а вот ты меня — вряд ли.
